import React from 'react';
import { View,
        KeyboardAvoidingView, 
        Image, 
        TextInput, 
        TouchableOpacity, 
        Text,
        StyleSheet 
    } from 'react-native';

export default function Login() {
    return (
        <KeyboardAvoidingView style={styles.background}>
            <View>
                <Image
                source={require(`../assets/img/icon.png`)}
                />
            </View>

            <View>
                <TextInput 
                placeholder="Username"
                autoCorrect={false}
                onChangeText={()=> {}}
                />
                <TextInput
                placeholder="Senha"
                autoCorrect={false}
                onChangeText={()=> {}}
                />

                <TouchableOpacity>
                    <Text>Entrar</Text>
                </TouchableOpacity>
                <TouchableOpacity>
                    <Text>Criar conta gratuita</Text>
                </TouchableOpacity>
            </View>
        </KeyboardAvoidingView>
    );
}

const styles = StyleSheet.create({
    background:{
        flex: 1,
        alignItems: 'center',
        justifyContent: 'center',
        backgroundColor: '#F5FCFF'
    }
});
